import React, { useEffect, useState } from "react";

const Students = () => {
  const [students, setStudents] = useState([]);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [editingStudent, setEditingStudent] = useState(null); // Track student being edited

  useEffect(() => {
    fetchStudents();
  }, []);

  // ‚úÖ Fetch students from backend
  const fetchStudents = () => {
    fetch("http://localhost:5000/students")
      .then((response) => response.json())
      .then((data) => setStudents(data))
      .catch((error) => console.error("Error fetching students:", error));
  };

  // ‚úÖ Add a student
  const addStudent = (e) => {
    e.preventDefault();

    fetch("http://localhost:5000/students/add", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ name, email }),
    })
      .then((response) => response.json())
      .then((data) => {
        alert(data.message);
        fetchStudents();
        setName("");
        setEmail("");
      })
      .catch((error) => console.error("Error adding student:", error));
  };

  // ‚úÖ Delete a student
  const deleteStudent = (id) => {
    if (!window.confirm("Are you sure you want to delete this student?"))
      return;

    fetch(`http://localhost:5000/students/delete/${id}`, { method: "DELETE" })
      .then((response) => response.json())
      .then((data) => {
        alert(data.message);
        fetchStudents();
      })
      .catch((error) => console.error("Error deleting student:", error));
  };

  // ‚úÖ Start editing a student
  const startEditing = (student) => {
    setEditingStudent(student);
    setName(student.name);
    setEmail(student.email);
  };

  // ‚úÖ Update a student's details
  const updateStudent = (e) => {
    e.preventDefault();

    fetch(`http://localhost:5000/students/update/${editingStudent._id}`, {
      method: "PUT",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ name, email }),
    })
      .then((response) => response.json())
      .then((data) => {
        alert(data.message);
        fetchStudents();
        setEditingStudent(null);
        setName("");
        setEmail("");
      })
      .catch((error) => console.error("Error updating student:", error));
  };

  return (
    <div style={styles.container}>
      <h2>üéì Students Page</h2>
      <p>Manage students and track their progress.</p>

      {/* Add / Update Student Form */}
      <form
        onSubmit={editingStudent ? updateStudent : addStudent}
        style={styles.form}
      >
        <input
          type="text"
          placeholder="Enter student name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          style={styles.input}
        />
        <input
          type="email"
          placeholder="Enter student email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
          style={styles.input}
        />
        <button type="submit" style={styles.button}>
          {editingStudent ? "‚úèÔ∏è Update Student" : "‚ûï Add Student"}
        </button>
      </form>

      {/* Show Student List */}
      {students.length === 0 ? (
        <p>No students found.</p>
      ) : (
        <ul style={styles.list}>
          {students.map((student) => (
            <li key={student._id} style={styles.listItem}>
              {student.name} - {student.email}
              <button
                onClick={() => startEditing(student)}
                style={styles.editButton}
              >
                ‚úèÔ∏è Edit
              </button>
              <button
                onClick={() => deleteStudent(student._id)}
                style={styles.deleteButton}
              >
                üóëÔ∏è Delete
              </button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

const styles = {
  container: { padding: "20px", textAlign: "center" },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    maxWidth: "300px",
    margin: "auto",
  },
  input: { padding: "8px", fontSize: "16px" },
  button: { padding: "10px", fontSize: "16px", cursor: "pointer" },
  list: {
    listStyleType: "none",
    padding: 0,
    maxWidth: "400px",
    margin: "auto",
  },
  listItem: {
    display: "flex",
    justifyContent: "space-between",
    padding: "10px",
    borderBottom: "1px solid #ddd",
  },
  editButton: {
    padding: "5px 10px",
    backgroundColor: "#FFD700",
    border: "none",
    cursor: "pointer",
  },
  deleteButton: {
    padding: "5px 10px",
    backgroundColor: "#FF4500",
    border: "none",
    cursor: "pointer",
    color: "#fff",
  },
};

export default Students;
